INSERT INTO `galette_mailing_history` (`mailing_id`, `mailing_sender`, `mailing_subject`, `mailing_body`, `mailing_date`, `mailing_recipients`, `mailing_sent`) VALUES
(2,	816,	'[AAE-ENSG] Voeux de l\'association',	'Bonjour  tous,\r\n\r\nL\'Association des Anciens lves de lENSG a le plaisir de vous souhaiter une excellente anne 2015 et vous informe de la publication de son bulletin annuel que vous trouverez  cette adresse : <a href=\"http://www.aae-ensg.eu/?page_id=42\">http://www.aae-ensg.eu/?page_id=42</a>.</br></br>\r\n\r\nL\'anne 2014 a vu l\'aboutissement d\'un projet important pour l\'association : la refonte du site internet (<a href=\"http://www.aae-ensg.eu/\">http://www.aae-ensg.eu/</a>) et la mise au point d\'un annuaire en ligne des adhrents. Chacun pourra consulter la base de donnes des anciens lves, et modifier et enrichir les informations le concernant,  l\'adresse suivante : <a href=\"http://adherents.aae-ensg.eu\">http://adherents.aae-ensg.eu</a>. Cet outil doit contribuer  faciliter la mise en rseau des membres de l\'association et  resserrer leurs liens. De nouvelles fonctionnalits sont prvues et seront dveloppes par un groupe de dveloppement, et par des lves de l\'ENSG.</br></br>\r\n\r\nForte du succs du repas des anciens lves 2014 qui a eu lieu  l\'ENSG et a rassembl une centaine de personnes, l\'association souhaite reconduire cette anne encore ce rendez-vous amical, qui prendra la forme d\'un buffet, et se tiendra dans le restaurant dentreprise de l\'IGN,  Saint-Mand, le <strong>jeudi 19 mars 2015  partir de 19h</strong>,  la suite de l\'<strong>Assemble Gnrale</strong> prvue le mme jour  18h,  l\'IGN galement.</br></br>\r\n\r\nVous tes chaleureusement invits  participer  ces deux vnements. Vous pourrez ainsi donner votre avis sur les actions de l\'association et lire les membres du CA lors de l\'AG, puis retrouver des anciens lves lors du buffet. Nous vous invitons donc  noter cette date dans votre agenda !</br></br>\r\n\r\nA trs bientt,</br></br>\r\n\r\nLquipe du conseil dadministration de lAAE-ENSG',	'2015-01-30 09:54:25',	'a:1:{i:816;s:38:\"GRESSIN Adrien <adrien.gressin@ign.fr>\";}',	1),
