(7,	1532,	'[AAE-ENSG] Rencontre annuelle 19/03 - Inscriptions ouvertes',	'Bonjour  tous,\r\n\r\nL\'Association des Anciens Elves de l\'ENSG a le plaisir de vous inviter  sa rencontre annuelle, le jeudi 19 mars 2015. Nous nous retrouverons autour d\'un buffet dans la salle du Goroom,  l\'IGN (Saint-Mand),  19h. Pour vous joindre  nous, il suffit de s\'inscrire ici : http://www.aae-ensg.eu/?wpgform_qv=repas-2015 , avant le 15 mars, et de nous faire parvenir votre participation de 15. \r\n\r\nRappelons que les adhrents sont galement convis  l\'Assemble Gnrale de l\'association, qui se tiendra ce mme jour,  18h en salles Hurault et Dufour,  l\'IGN. Des lections sont prvues, n\'hsitez donc pas  vous prsenter pour faire partie du CA de l\'association, et  nous faire parvenir une procuration si vous ne pouvez tre prsent. \r\n\r\nA trs bientt,\r\nLquipe du conseil dadministration de lAAE-ENSG\r\nhttp://www.aae-ensg.eu/ ',	'2015-03-02 09:50:59',	'a:418:{i:769;s:45:\"AUDUSSEAU Antoine <antoine.audusseau@ensg.eu>\";i:775;s:41:\"BEAUNIER Audrey <audrey.beaunier@ensg.eu>\";i:776;s:44:\"BELLEC Anne <Anne.BELLEC@equipement.gouv.fr>\";i:777;s:46:\"BERGUE Alain <Alain.Bergue@nantesmetropole.fr>\";i:778;s:52:\"BERNARD Antoine <Antoine.Bernard@equipement.gouv.fr>\";i:782;s:37:\"BOURDET Alice <Alice.Bourdet@ensg.eu>\";i:787;s:31:\"CARME Anas <acarme@gmail.com>\";i:789;s:34:\"CEYTE Arnaud <arnaud.ceyte@ign.fr>\";i:791;s:36:\"CHAUMET Alain <Alain.CHAUMET@ign.fr>\";i:794;s:38:\"COGENT Armelle <armelle.cogent@ign.fr>\";i:798;s:33:\"DELHAL Alix <alix.delhal@ensg.eu>\";i:799;s:39:\"DEMELLIER Arnaud <ademellier@tpmed.org>\";i:803;s:37:\"DUPERET Alain <alain.duperet@free.fr>\";i:807;s:42:\"EYSSIDIEUX Alain <Alain.Eyssidieux@ign.fr>\";i:810;s:29:\"FUGA Alba <alba.fuga@ensg.eu>\";i:812;s:49:\"GHAYEM-AMANI Aurore <aurore.ghayem-amani@ensg.eu>\";i:816;s:38:\"GRESSIN Adrien <adrien.gressin@ign.fr>\";i:821;s:49:\"HEUZE Anne <anne.chasle-heuze@equipement.gouv.fr>\";i:822;s:37:\"HIBERT Arthur <arthur.