INSERT INTO `galette_texts` (`tid`, `tref`, `tsubject`, `tbody`, `tlang`, `tcomment`) VALUES
(1,	'sub',	'[{ASSO_NAME}] Your identifiers',	'Hello,\r\n\r\nYou\'ve just been subscribed on the members management system of {ASSO_NAME}.\r\n\r\nIt is now possible to follow in real time the state of your subscription and to update your preferences from the web interface.\r\n\r\nPlease login at this address:\r\n{LOGIN_URI}\r\n\r\nUsername: {LOGIN}\r\nPassword: {PASSWORD}\r\n\r\nSee you soon!\r\n\r\n(this mail was sent automatically)',	'en_US',	'New user registration'),
(2,	'sub',	'[{ASSO_NAME}] Votre adhsion',	'Bonjour,\n\nVous venez d\'adhrer  {ASSO_NAME}.\n\nVous pouvez dsormais accder  vos coordonnes et souscriptions en vous connectant  l\'adresse suivante :\n{LOGIN_URI}\n\nIdentifiant : {LOGIN}\nMot de passe : Merci de rinitialiser votre mot de passe sur le site\n\nA bientt!\n\n(Ce courriel est un envoi automatique)',	'fr_FR',	'Nouvelle adhsion'),
(4,	'pwd',	'[{ASSO_NAME}] Your identifiers',	'Hello,\r\n\r\nSomeone (probably you) asked to recover your password.\r\n\r\nPlease login at this address to set your new password :\r\n{CHG_PWD_URI}\r\n\r\nUsername: {LOGIN}\r\nThe above link will be valid until {LINK_VALIDITY}.\r\n\r\nSee you soon!\r\n\r\n(this mail was sent automatically)',	'en_US',	'Lost password email'),
(5,	'pwd',	'[{ASSO_NAME}] Vos Identifiants',	'Bonjour,\n\nQuelqu\'un (probablement vous) a demand la rcupration de votre mot de passe.\n\nConnectez vous  cette adresse pour valider le nouveau mot de passe :\n{CHG_PWD_URI}\n\nIdentifiant : {LOGIN}\nLe lien ci-dessus sera valide jusqu\'au {LINK_VALIDITY}.\n\nA Bientt!\n\n(Ce courriel est un envoi automatique)',	'fr_FR',	'Rcupration du mot de passe'),
(7,	'contrib',	'[{ASSO_NAME}] Your contribution',	'Hello,\r\n\r\nYour contribution has successfully been taken into account by {ASSO_NAME}.\r\n\r\nIt is valid until {DEADLINE}.\r\n\r\nYou can now login and browse or modify your personnal data using your galette identifiers at this address:\r\n{LOGIN_URI}.\r\n\r\n{CONTRIB_INFO}\r\n\r\nSee you soon!\r\n\r\n(this mail was sent automatically)',	'en_US',	'Receipt send for new contribution'),
(8,	'contrib',	'[{ASSO_NAME}] Votre cotisation',	'Bonjour,\n\nVotre cotisation a t enregistre et valide par l\'association {ASSO_NAME}.\n\nElle est valable jusqu\'au {DEADLINE}\n\nVous pouvez dsormais accder  vos donnes personnelles  l\'aide de vos identifiants ({LOGIN})  l\'adresse suivante :\n{LOGIN_URI}.\n\n{CONTRIB_INFO}\n\nA Bientt!\n\n(Ce courriel est un envoi automatique)',	'fr_FR',	'Accus de rception de cotisation'),
(10,	'newadh',	'[{ASSO_NAME}] New registration from {NAME_ADH}',	'Hello dear Administrator,\r\n\r\nA new member has been registered with the following informations:\r\n* Name: {NAME_ADH}\r\n* Login: {LOGIN}\r\n* E-mail: {MAIL_ADH}\r\n\r\nYours sincerly,\r\nGalette',	'en_US',	'New user registration (sent to admin)'),
(11,	'newadh',	'[{ASSO_NAME}] Nouvelle inscription de {NAME_ADH}',	'Bonjour cher Administrateur,\n\nUn nouveau membre a t enregistr avec les informations suivantes :\n* Nom : {NAME_ADH}\n* Login : {LOGIN}\n* Courriel : {MAIL_ADH}\n\nBien sincrement,\nGalette',	'fr_FR',	'Nouvelle adhsion (envoye a l\'admin)'),
(13,	'newcont',	'[{ASSO_NAME}] New contribution for {NAME_ADH}',	'Hello dear Administrator,\r\n\r\nA contribution from {NAME_ADH} has been registered (new deadline: {DEADLINE})\r\n{CONTRIB_INFO}\r\n\r\nYours sincerly,\r\nGalette',	'en_US',	'New contribution (sent to admin)'),
(14,	'newcont',	'[{ASSO_NAME}] Nouvelle contribution de {NAME_ADH}',	'Bonjour cher Administrateur,\n\nUne contribution de {NAME_ADH} a t enregistre (nouvelle chance: {DEADLINE})\n{CONTRIB_INFO}\n\nBien sincrement,\nGalette',	'fr_FR',	'Nouvelle contribution (envoye a l\'admin)'),
(16,	'newselfadh',	'[{ASSO_NAME}] New self registration from {NAME_ADH}',	'Hello dear Administrator,\r\n\r\nA new member has self registred on line with the following informations:\r\n* Name: {NAME_ADH}\r\n* Login: {LOGIN}\r\n* E-mail: {MAIL_ADH}\r\n\r\nYours sincerly,\r\nGalette',	'en_US',	'New self registration (sent to admin)'),
(17,	'newselfadh',	'[{ASSO_NAME}] Nouvelle auto inscription de {NAME_ADH}',	'Bonjour cher Administrateur,\n\nUn nouvel adhrent s\'est auto inscrit en ligne avec les informations suivantes :\n* Nom : {NAME_ADH}\n* Login : {LOGIN}\n* Courriel : {MAIL_ADH}\n\nBien sincrement,\nGalette',	'fr_FR',	'Nouvelle auto-inscription (envoye a l\'admin)'),
(19,	'accountedited',	'[{ASSO_NAME}] Your account has been modified',	'Hello!\r\n\r\nYour account on {ASSO_NAME} (with the login \'{LOGIN}\') has been modified by an administrator or a staff member.\r\n\r\nYou can log into {LOGIN_URI} to review modifications and/or change it.\r\n\r\nSee you soon!\r\n\r\n(this mail was sent automatically)',	'en_US',	'Informs user that his account has been modified'),
(20,	'accountedited',	'[{ASSO_NAME}] Votre compte a t modifi',	'Bonjour !\n\nVotre compte chez {ASSO_NAME} (avec l\'identifiant \'{LOGIN}\') a t modifi par un administrateur ou un membre du bureau.\n\nVous pouvez vous connecter  l\'adresse {LOGIN_URI} pour vrifier ces informations ou les modifier.\n\n bientt !\n\n(ce courriel est un envoi automatique)',	'fr_FR',	'Informe l\'utilisateur que son compte a t modifi'),
(22,	'impendingduedate',	'[{ASSO_NAME}] Your membership is about to expire',	'Hello,\r\n\r\nYour {ASSO_NAME} membership is about to expire in {DAYS_REMAINING} days.\r\n\r\nSee you soon!\r\n\r\n(this mail was sent automatically)',	'en_US',	'Impending due date'),
(23,	'impendingduedate',	'[{ASSO_NAME}] Votre adhsion arrive  terme',	'Bonjour,\n\nVotre adhsion  {ASSO_NAME} arrive  son terme dans {DAYS_REMAINING} jours.\n\nA bientt!\n\n(ce courriel est un envoi automatique)',	'fr_FR',	'chance proche'),
(25,	'lateduedate',	'[{ASSO_NAME}] Your membership has expired',	'Hello,\r\n\r\nYour {ASSO_NAME} membership has expired for {DAYS_EXPIRED} days.\r\n\r\nSee you soon!\r\n\r\n(this mail was sent automatically)',	'en_US',	'Late due date'),
(26,	'lateduedate',	'[{ASSO_NAME}] Votre adhsion a expir',	'Bonjour,\n\nVotre adhsion  {ASSO_NAME} a expir depuis {DAYS_EXPIRED} jours.\n\nA bientt!\n\n(ce courriel est un envoi automatique)',	'fr_FR',	'chance dpasse');
